import { AuthContextProvider } from "./context/AuthContext";
import { GenreContextProvider } from "./context/MoviesGenres";
import Home from "./pages/Home";

const App = () => {
  return (
    <>
    <GenreContextProvider>
      <AuthContextProvider>
        <Home />
      </AuthContextProvider>
      </GenreContextProvider>
    </>
  );
};

export default App;
